	void LoadShaderPackages(T3EffectCacheContext& context, RenderThreadContext* pRenderThreadContext, const std::vector<String>& shaderPackNames){
		if (!context._OK())
			return;
		int _unused{};
		for(auto& it : shaderPackNames){
			if(ends_with(it,".t3fxpack")){
				DataStream* pResource = pRenderThreadContext->OpenShaderPackage(it);
				if(pResource){
					if(!LoadPackage(context, pResource, _unused))
						TTL_Log("Could not load shader package %s", it.c_str());
					delete pResource;
				}
				else {
					DataStreamFileDisc stream = _OpenDataStreamFromDisc_(it.c_str(), READ);
					if (stream.IsInvalid()) {
						TTL_Log("ERROR: %s: shader pack file could not be found on disc or in the resources! Ignoring...", it.c_str());
					}
					else {
						if (!LoadPackage(context, &stream, _unused))
							TTL_Log("Could not load shader package %s", it.c_str());
					}
				}
			}else{
				TTL_Log("ERROR: %s: shader pack cannot be loaded yet from non t3fxpack files/folder!", it.c_str());
			}
		}
	}

	bool LoadPackageHeader(T3EffectCachePackageHeader& header, DataStream& inpack, bool bCheckEffectVersion){
		union {
			char pData[8] = { 0,0,0,0,0,0,0,0 };
			u64 l;
		};
		l = 0;
		inpack.Serialize(pData, 4);
		if (l == 0x844FF3C8llu) {
			header.mMagic = (u32)l;
			inpack.Serialize(pData, 4);
			header.mVersion = (u32)l;
			if (header.mVersion != GetVersion(ePlatform_PC) && bCheckEffectVersion) {
				TTL_Log("Cannot load shader package. Version not supported in header for platform.");
				return false;
			}
			inpack.Serialize(pData, 4);
			header.mProgramCount = (u32)l;
			inpack.Serialize(pData, 4);
			header.mShaderCount = (u32)l;
			inpack.Serialize(pData, 4);
			header.mShaderDataOffset = (u32)l;
		}
		else {
			TTL_Log("Cannot load shader package. Invalid header magic, this shader pack may be an old version!");
			return false;
		}
		return true;
	}

	bool LoadPackageShader(T3EffectCachePackageShader& shader, DataStream& inpack){
		//Read<5> bitset
		union {
			char pData[8] = { 0,0,0,0,0,0,0,0 };
			u64 l;
		};
		l = 0;
		inpack.Serialize(pData, 4);
		shader.mShaderType = (T3MaterialShaderType)((u32)l);
		u32 bitSetWords = sSetKeyIndex >= TelltaleToolLib_GetGameKeyIndex("WD4") ? 5 : sSetKeyIndex >= TelltaleToolLib_GetGameKeyIndex("BAT") ? 4 : 3;
		for (int i = 0; i < bitSetWords; i++) {
			inpack.Serialize(pData, 4);
			shader.mNeededParameters.mWords[i] = (u32)l;
		}
		for (int i = bitSetWords; i < 5; i++)
			shader.mNeededParameters.mWords[i] = 0;
		inpack.Serialize(pData, 4);
		shader.mOffset = (u32)l;
		inpack.Serialize(pData, 4);
		shader.mSize = (u32)l;
		if(shader.mShaderType > eMaterialShader_Count){
			TTL_Log("Cannot read t3fxpack! Shader data is invalid likely unsupported version! At internal container offset 0x%llX\n", inpack.GetPosition());
			return false;
		}
		return true;
	}

	bool LoadPackageProgram(T3EffectCacheContext& context, T3EffectCachePackageProgram& program, DataStream& inpack){
		//Read<3> bitset
		union {
			char pData[8] = { 0,0,0,0,0,0,0,0 };
			u64 l;
		};
		l = 0;
		inpack.Serialize(pData, 4);
		program.mEffectType = (T3EffectType)((u32)l);
		program.mEffectFeatures.SetTether(context.mpVersionDatabase);
		int numWords = sSetKeyIndex == TelltaleToolLib_GetGameKeyIndex("WDM") ? 2 : 3;
		for (int i = 0; i < numWords; i++) {
			inpack.Serialize(pData, 4);
			program.mEffectFeatures.mWords[i] = (u32)l;
		}
		if (sSetKeyIndex != TelltaleToolLib_GetGameKeyIndex("MCSM")) {
			inpack.Serialize(pData, 8);
			program.mMaterialCrc = l;
		}
		else
			program.mMaterialCrc = 0;
		inpack.Serialize(pData, 4);
		program.mEffectQuality = (T3EffectQuality)l;
		inpack.Serialize(pData, 4);
		program.mPassCount = (u32)l;
		inpack.Serialize(pData, 4);
		program.mSamplerCount = (u32)l;
		if(program.mSamplerCount > 255 || program.mEffectQuality >= context.mpVersionDatabase->mQualities.size() || program.mPassCount > 255 ||
			(program.mMaterialCrc != 0 && program.mMaterialCrc < 0xFFFFFFFF) || program.mEffectType > context.mpVersionDatabase->mEffects.size()){
			TTL_Log("Cannot read t3fxpack! Program data is invalid likely unsupported version! At internal container offset 0x%llX\n", inpack.GetPosition());
			return false;
		}
		return true;
	}

	bool LoadPackageSampler(T3EffectCacheSampler& sampler, DataStream& inpack){
		union {
			char pData[8] = { 0,0,0,0,0,0,0,0 };
			u64 l;
		};
		l = 0;
		inpack.Serialize(pData, 4);
		sampler.mSamplerParameterIndex = (u32)l;
		inpack.Serialize(pData, 4);
		sampler.mSamplerState.mData = (u32)l;
		inpack.Serialize(pData, 4);
		sampler.mSamplerStateMask.mData = (u32)l;
		return true;
	}

