	bool LoadPackage(T3EffectCacheContext& context, DataStream* pStream, int& outver){
		if (!context._OK())
			return false;
		u64 pContainerSize = 0;
		union {
			char pData[8] = { 0,0,0,0,0,0,0,0 };
			u64 l;
		};
		l = 0;
		std::shared_ptr<DataStreamContainer> pInpack = DataStreamContainer::ReadContainer(pStream, 0, &pContainerSize);
		context.mpShaderBinary = pInpack;
		DataStreamContainer& inpack = *pInpack.get();
		T3EffectCachePackageHeader header{};
		if(inpack.ok){
			if (!LoadPackageHeader(header, inpack, false))
				return false;//always load header
			outver = header.mVersion;
			u32 shaderHeaderBytes = header.mShaderDataOffset - inpack.GetPosition();
			T3EffectCachePackageShader* pTmpShaders = new T3EffectCachePackageShader[header.mShaderCount];
			for (int i = 0; i < header.mShaderCount; i++)
				if (!LoadPackageShader(pTmpShaders[i], inpack))
					return false;
			//Below was an absolute ass to decompile, IDA just stopped above and ended the function decompiled code. Got ghidra to do it though with help of function offsets and struct outlines from IDA.
			T3EffectCachePackageProgram program{};
			std::vector<T3EffectCacheShader*> pShaders{};
			pShaders.reserve(header.mShaderCount);
			for(int shaderIndex = 0; shaderIndex < header.mShaderCount; shaderIndex++){
				T3EffectCacheShader* pLoadedShader = (T3EffectCacheShader*)AllocateHeap(context, sizeof(T3EffectCacheShader), 8);
				pLoadedShader->mShaderType = pTmpShaders[shaderIndex].mShaderType;
				pLoadedShader->mNeededParameters = pTmpShaders[shaderIndex].mNeededParameters;
				pLoadedShader->mOffset = pTmpShaders[shaderIndex].mOffset;
				pLoadedShader->mSize = pTmpShaders[shaderIndex].mSize;
				pLoadedShader->mpGFXShader = 0;
				pShaders.push_back(pLoadedShader);
				context.mShaders.insert_tail(pLoadedShader);
			}
			delete[] pTmpShaders;
			//FUN_1403b8fb0, loadpackage in t3effectcache
			for(int i = 0; i < header.mProgramCount; i++){
				if (!LoadPackageProgram(context, program, inpack))
					return false;
				T3EffectCacheParams params{context};
				params.mMaterialCrc = program.mMaterialCrc;
				params.mQuality = program.mEffectQuality;
				params.mStaticFeatures = program.mEffectFeatures;//Cool ranged bitset copy constructor from different template parameters.
				T3EffectCacheBucket* pBucket = GetBucket(context, program.mEffectType, params);
				DynamicFeatures programDynamicFeatures{ context.mpVersionDatabase };
				programDynamicFeatures = (program.mEffectFeatures);
				u32 curKey = GetProgramKey(programDynamicFeatures);
				//Check if the given bucket contains a program with the key (only dependent on dynamic features).
				T3EffectCacheProgram* pLoadedProgram;
				if (pLoadedProgram = FindProgram(context, *pBucket, curKey))
					;
				else
					pLoadedProgram = (T3EffectCacheProgram*)AllocateHeap(context, sizeof(T3EffectCacheProgram), 8);
				pLoadedProgram->mStatus = (u8)eEffectProgramStatus_Compiled;
				pLoadedProgram->mpBucket = pBucket;
				pLoadedProgram->mFeatures = programDynamicFeatures;
				pLoadedProgram->mPassCount = (u8)program.mPassCount;
				pLoadedProgram->mSamplerCount = (u8)program.mSamplerCount;
				pLoadedProgram->mpStream = pInpack;
				AllocateProgramMemory(context, *pLoadedProgram);
				for(u8 sampler = 0; sampler < pLoadedProgram->mSamplerCount; sampler++)
					if (!LoadPackageSampler(pLoadedProgram->mSamplers[sampler], inpack))
						return false;
				for(u8 passIndex = 0; passIndex < pLoadedProgram->mPassCount; passIndex++){
					if (context.mpVersionDatabase->mEffects[pBucket->mEffectType].mCategory == eEffectCategory_Compute) {
						T3EffectCachePass_Compute& pass = pLoadedProgram->mPassesCompute[passIndex];
						inpack.Serialize(pData, 4);
						pass.mThreadGroupSizeX = (u32)l;
						inpack.Serialize(pData, 4);
						pass.mThreadGroupSizeY = (u32)l;
						inpack.Serialize(pData, 4);
						pass.mThreadGroupSizeZ = (u32)l;
						inpack.Serialize(pData, 4);
						i32 shaderIndex = (i32)l;
						if (shaderIndex >= 0 && shaderIndex < header.mShaderCount) {
							T3EffectCacheShader* pLoadedShader = pShaders[shaderIndex];
							pLoadedProgram->mNeededParameters.Set(pLoadedShader->mNeededParameters);
							pass.mpComputeShader = pLoadedShader;
							pass.mInitialShaderIndex = shaderIndex;
						}
						else {//no shader attach 
							pass.mpComputeShader = NULL;
							pass.mInitialShaderIndex = (u32)i;
						}
					}else{//DRAW
						T3EffectCachePass_Draw& pass = pLoadedProgram->mPassesDraw[passIndex];
						l = 0;
						for (int i = 0; i < 3; i++) {
							inpack.Serialize(pData, 4);
							pass.mRenderStateBlock.mData.mData[i] = (u32)l;
						}
						for (int i = 0; i < 3; i++) {
							inpack.Serialize(pData, 4);
							pass.mRenderStateMask.mData.mData[i] = (u32)l;
						}
						int numShaderTypes = sSetKeyIndex >= TelltaleToolLib_GetGameKeyIndex("BAT") ? 3 : 2;
						for (int i = 0; i < numShaderTypes; i++) {
							inpack.Serialize(pData, 4);
							i32 shaderIndex = (i32)l;
							if(shaderIndex >= 0 && shaderIndex < header.mShaderCount){
								T3EffectCacheShader* pLoadedShader = pShaders[shaderIndex];
								pLoadedProgram->mNeededParameters.Set(pLoadedShader->mNeededParameters);
								pass.mpDrawShader[i] = pLoadedShader;
								pass.mInitialShaderIndex[i] = shaderIndex;
							}
							else {//-1 (mostly geom) no shader attach 
								pass.mpDrawShader[i] = NULL;
								pass.mInitialShaderIndex[i] = (u32)-1;
							}
						}
						if (numShaderTypes != 3)
							pass.mpDrawShader[2] = NULL;// no geometry
					}
				}
				InsertProgramKey(context, *pBucket, curKey, pLoadedProgram);
				context.mPrograms[eEffectProgramStatus_Compiled].insert_tail(pLoadedProgram);
			}
			//first shader: vertex, 0 3 4 29 (effect parameter): camera, object, instance, material main
			//shader param 7 bytes: u16 T3EffectParameterType, u16 scalarSize (bytes/4), 
			//00w 180w 0b FFb 0b cam
			//03w 050w 1b FFb 0b obj
			//04w 020w 2b FFb 0b inst
			//29w 006w 3b FFb 0b mat main
		}else{
			TTL_Log("Cannot load shader package. Not wrapped in a container, likely a corrupt file.");
		}
		return true;
	}

