	sQualityEntry[eRenderQuality_Low].mLighVisibilityThreshold = 0.002f;
	sQualityEntry[eRenderQuality_Lowest].mLighVisibilityThreshold = 0.002f;

	sQualityEntry[eRenderQuality_High].mDecalVisibleDistance = 100.f;
	sQualityEntry[eRenderQuality_Mid].mDecalVisibleDistance = 20.f;
	sQualityEntry[eRenderQuality_LowPlus].mDecalVisibleDistance = 20.f;
	sQualityEntry[eRenderQuality_Low].mDecalVisibleDistance = 20.f;
