void T3::Shutdown(){
	::T3EffectCache::Shutdown();
	if (!sbOpen)
		return;
	sbOpen = 0;
	sCachedLayouts.clear();
	for (int i = 0; i < 19; i++)
		spDefaultVertexStates[i].reset();
	for (int i = 0; i < 4; i++)
		spDefaultGenericBuffer[i].reset();
	for (int i = 0; i < 2; i++)
		spDefaultIndexBuffer[i].reset();
	T3RenderTargetUtil::FreeAllRenderTargets();
	RenderFrameUpdateList::Shutdown();
}